    false,nt"url": null,nt"notes": "On June 9, 1940 an inspection was made
    of the Tewaukon Lake Easement Refuge in North Dakota.  Considerable improvements
    had been made since the last inspection. At the roadway dike which divides the upper
    lake from the main lower lake, the riprapping on the upstream side of the embankment
    has been considerably improved.  The roadway at the extreme end of the main lake
    has been repaired, and the riprap at the main spillway is in very good shape.",nt"license_title":
